INSERT INTO `activity_proposal` (`Proposal_ID`, `Account_ID`, `ActivityName`, `DateActivity`, `StartTime`, `EndTime`, `Nature`, `Objectives`, `Rationale`, `ActivityChair`, `ChairContactNumber`, `Participants`, `ActivityVenue`, `ProposalType1`, `Partners`, `ProposalType2`, `NonAcademicType`, `Specified`, `ProposalStatus`, `OfficeProposal`) VALUES
('1385', 'BITS', 'Get to Know Outlook', '2018-03-07', '09:00', '12:00', 'The activity is a hands on workshop about the application, Microsoft\nOutlook. We will be educating the participants on how to use Microsoft\nOutlook to further be of help to the participants and their respective\norganizations. ', '1. We will be educating the participants on how to use Outlook to further be of help to the participants\n2. To form a more corporate and formal email address.\n3. To aid the SOC in connecting with the students faster.', '1. Love of Christ and Neighbor - aiding our student body for a more efficient and effective experience of disseminating information\n2. Community - the SOC will be gathered into one Bedan community to further be of help to its students.\n3. Discipline - the activity will be used to provide responsibility to disseminate information to each rep ', 'Monique C. Patalinghug', '09184316311', 'Student Organizational Circle', 'Laboratory B', 'Collaborative', 'CAS Student Council', 'Academic', NULL, '', 'PENDING', 'SC_SG'),
('8222', 'BITS', 'Soldiers in Training', '2018-01-20', '08:00', '17:00', 'This activity is a traditional event of the organization. This event\ninvites its participants outside San Beda to showcase the\ngenuineness. This activity helps the people outside of San Beda\nto be enlightened, and to be competent of the trends in the\ntechnology world.', '1. Teach the participants the essentials in using Microsoft\nOffice like Word, and Excel, so that it may help them to\norganize their class records, syllabus, lessons and their\nway in teaching.\n2. Apply these new skills in their work for them to increase\nproductivity and efficiency in their workplace.\n3. This training program will help them make their work\neasier and prepare documents faster using the tips and\ntricks in using Microsoft Office.', 'Community- the organization encourages all Bedans to\ntake part in the event and be enlightened. \nDiscipline- after the event, it is expected that the\nparticipants should practice on how to use these\nlearnings in the form of conduct \nStability- this shows the consistency and the day to day\nsuccess of technology as it improves gradually.', 'Charlene S. Almoite', '+639268269877', '50 Soldiers of AFP', 'Lab B', 'Collaborative', 'ICIC', 'Non-Academic', 'Community Involvement', '', 'PENDING', 'SC_SG'),
('9789', 'PSSBU', 'untitled', '', '', '', '', '', '', '', '', '', '', NULL, '', NULL, NULL, '', 'DRAFT', 'N/A');
